CREATE TABLE `aboutbutterfly` (
  `id` int(11) UNSIGNED NOT NULL,
  `typeid` int(11) UNSIGNED DEFAULT NULL,
  `features` varchar(2000) DEFAULT NULL,
  `typename` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Дамп данных таблицы `aboutbutterfly`
--

INSERT INTO `aboutbutterfly` (`id`, `typeid`, `features`, `typename`) VALUES
(1, 1, 'Размах крыльев 90—100 мм. Самки обычно крупнее самцов. Самцы представлены одной формой. Основной фон крыльев — чёрный. Передние крылья чёрного цвета с тонкими серыми прожилками, вдоль наружного края крыла располагаются пятна диаметром 2—3 мм, уменьшающиеся в размере к вершине, через одну срединную ячейку, белого цвета. На задних крыльях в средней части располагается ряд пятен овальной формы белого цвета, в каждой ячейке. Грудь и брюшко чёрного цвета.', 'PAPILIO POLYTES'),
(2, 2, 'Восхитительная красота бабочек Графиум (Graphium agamemnon) действительно впечатляет — среди других видов такая расцветка встречается удивительно редко. Насыщенные изумрудные пятна на верхней части крыльев ярко выделяются на угольно-черном фоне, тогда как нежно-розовые и пудровые оттенки украшают нижнюю часть крылышек. Оторваться от разглядывания такой красоты действительно сложно.', 'GRAPHIUM AGAMEMNON'),
(5, 3, 'Бабочка с черным телом и размахом крыльев около 70–85 миллиметров (2,8–3,3 дюйма). У этого вида высокая степень полового диморфизма . Самка миметика с множеством морфов. Верхняя сторона крыльев угольно-черная, смещена тремя парами белых пятен, двумя на переднем крыле и одним на заднем. Эти пятна окружены пурпурным переливом. Кроме того, на верхней стороне заднего крыла видна серия маленьких белых точек.', 'HYPOLIMNAS BOLINA'),
(6, 4, 'Бабочки средних размеров. Крылья широкие, наружный край задних крыльев с угловатыми выступами или зазубринами. Окраска верхней и нижней стороны крыльев преимущественно пёстрая и яркая. Щупики большие, косо торчащие вперед. Передние ноги редуцированы, не используются при хождении, лишены коготков и покрыты густыми волосками. Задние голени с одной парой шпор. Усики с веретеновидной булавой.', 'CETHOSIA BIBLIS'),
(7, 5, 'Графическая комбинация черного и снежно- белого. Основания крылышек залиты бледно-желтым цветом.  Медленный и грациозный скользящий полет.  За эти отличительные особенности бабочку часто называют белой лесной нимфой. Бабочка летает в чаще влажных тропических лесов. Идея Левконоя неприхотлива, поэтому прекрасно живёт в домашних условиях, питаясь сладким вареньем, разведённым с водой, натуральным соком и переспевшими фруктами.', 'IDEA LEUCONOE'),
(8, 6, 'Papilio palinurus имеет размах крыльев , достигающий примерно 8–10 сантиметров (3,1–3,9 дюйма). Верхняя сторона крыльев покрыта пудрой из зеленой чешуи, а фон варьируется от темно-зеленоватого до черного с широкими яркими изумрудно-зелеными металлическими полосами. Нижняя сторона черного цвета с оранжевыми, белыми и синими пятнами по краям задних крыльев, на конце которых видны удлиненные хвосты.  Эти бабочки летают быстро и довольно быстро. Гусеницы питаются растениями рода Euodia , принадлежащими к семейству Rutaceae , широко известному как семейство rue или цитрусовые.', 'PAPILIO PALINURUS');

