) ENGINE=InnoDB DEFAULT CHARSET=utf8;

--
-- Дамп данных таблицы `alivebutterfly`
--

INSERT INTO `alivebutterfly` (`id`, `typename`, `price`, `amount`, `habitat`, `img`, `typeid`, `size`, `lifetime`) VALUES
(6, 'PAPILIO POLYTES', 350, 100, 'Распространена в Южной и Юго-Восточной Азии, включая Филиппины, Индонезию, Микронезию. Papilio polytes предпочитают умеренно лесистые участки влажных районов Азии, встречаются в горах, городских садах и на цитрусовых плантациях.', , 1, 90, 25);
INSERT INTO `alivebutterfly` (`id`, `typename`, `price`, `amount`, `habitat`, `img`, `typeid`, `size`, `lifetime`) VALUES
(7, 'GRAPHIUM AGAMEMNON', 500, 50, 'Вид распространен в тропических лесах с влажным климатом, обитает вдоль водоемов, встречается в городах и мегаполисах. Распространена в Юго-восточной Азии, Индии, Шри-Ланке и Австралии. Graphium agamemnon является широко распространенным видом, не находящимся под угрозой.', , 2, 95, 20);
INSERT INTO `alivebutterfly` (`id`, `typename`, `price`, `amount`, `habitat`, `img`, `typeid`, `size`, `lifetime`) VALUES
(8, 'HYPOLIMNAS BOLINA', 700, 40, 'Встречается на Мадагаскаре на западе, через Юг и Юго-Восточную Азию , Камбоджу , острова южной части Тихого океана (Французская Полинезия , Тонга , Тувалу , Самоа и Вануату ) и встречается в некоторых частях Австралии , Япония и Новая Зеландия. Довольно обычная бабочка, которую можно встретить в слегка лесистой местности, лиственных лесах, густых и влажных кустарниках и в более зеленых частях среды обитания человека.', , 3, 70, 15);
INSERT INTO `alivebutterfly` (`id`, `typename`, `price`, `amount`, `habitat`, `img`, `typeid`, `size`, `lifetime`) VALUES
(9, 'CETHOSIA BIBLIS', 340, 50, 'Этот вид встречается с Индийского субконтинента к востоку до Юго-Восточная Азия и Восточная Азия , восточная граница - Филиппины , а южная граница - Индонезия.', , 4, 9, 10);
INSERT INTO `alivebutterfly` (`id`, `typename`, `price`, `amount`, `habitat`, `img`, `typeid`, `size`, `lifetime`) VALUES
(10, 'IDEA LEUCONOE', 600, 50, 'Распространена в Индокитае, Малайзии, Индонезии, Филиппинах и Тайване. Населяет влажные тропические леса Юго-восточной Азии.', , 5, 15, 14);
INSERT INTO `alivebutterfly` (`id`, `typename`, `price`, `amount`, `habitat`, `img`, `typeid`, `size`, `lifetime`) VALUES
(11, 'PAPILIO PALINURUS', 700, 60, 'Этот вид обитает в основном в Юго-Восточной Азии, особенно в Бирма - полуостров Малайзия , Суматра , Борнео , Индонезия (Симеулуэ , остров Ниас ), Филиппины (Басилан , Палаван , Балабак , Куйо , Бусуанга и Думаран ). Papilio palinurus обитает в девственных лесах Азии.', , 6, 10, 25);

