--

INSERT INTO `chrysalis` (`id`, `typename`, `price`, `amount`, `description`, `timetoborn`, `typeid`, `img`) VALUES
(3, 'GRAPHIUM AGAMEMNON', 250, 55, 'Куколки зеленые или коричневатые. Они находятся на нижней стороне листьев, иногда сверху, и удерживается с помощью пояска из паутины.', 12, 2, );
INSERT INTO `chrysalis` (`id`, `typename`, `price`, `amount`, `description`, `timetoborn`, `typeid`, `img`) VALUES
(4, 'PAPILIO POLYTES', 500, 20, 'Окраска куколки зависит от фона места прикрепления: на листе — она зеленая; на стволе дерева — бурая. Благодаря покровительственной окраске обнаружить ее почти невозможно. В северных районах куколка полита зимует.', 10, 1, );
INSERT INTO `chrysalis` (`id`, `typename`, `price`, `amount`, `description`, `timetoborn`, `typeid`, `img`) VALUES
(5, 'HYPOLIMNAS BOLINA', 500, 30, 'Встречается на Мадагаскаре на западе, через Юг и Юго-Восточную Азию , Камбоджу , острова южной части Тихого океана (Французская Полинезия , Тонга , Тувалу , Самоа и Вануату ) и встречается в некоторых частях Австралии , Япония и Новая Зеландия. Довольно обычная бабочка, которую можно встретить в слегка лесистой местности, лиственных лесах, густых и влажных кустарниках и в более зеленых частях среды обитания человека.', 8, 3, );
INSERT INTO `chrysalis` (`id`, `typename`, `price`, `amount`, `description`, `timetoborn`, `typeid`, `img`) VALUES
(6, 'CETHOSIA BIBLIS', 650, 30, 'Из этой куколки (кокона) бабочки рождается чудесная живая бабочка Cethosia Biblis или как ее еще называют Цетозия Библис. Также, бабочку Cethosia Biblis еще называют Златоглазка Библис, ее оригинальные рисунок и окрас знамениты на весь мир, и напоминают арабскую вязь. Размер бабочки составляет 6-9см. Данные бабочки очень хорошо подходят для приготовления салюта из бабочек, благодаря их активности. Также, живые бабочки Cethosia Biblis очень подходят для зимних садов и оранжерей, так как они находятся постоянно в движении. Купив куколку (кокон) бабочки Cethosia Biblis (Цетозия Библис) для выращивания, Вы однозначно получите незабываемые впечатления и много восторга!', 14, 4, );
INSERT INTO `chrysalis` (`id`, `typename`, `price`, `amount`, `description`, `timetoborn`, `typeid`, `img`) VALUES
(7, 'IDEA LEUCONOE', 860, 60, 'Из этой куколки (кокона) бабочки рождается чудесная живая бабочка Idea Leuconoe или как ее еще называют Гиполимнас Болина. Также, живая бабочка Idea Leuconoe отличается своеобразным полетом, похожим на падение кусочка бумаги. Размер бабочки составляет 12-15см. Данные бабочки очень хорошо подходят для приготовления салюта из бабочек, благодаря ее активности. Также, живые бабочки Idea Leuconoe очень подходят для зимних садов и оранжерей, так как они находятся постоянно в движении. Купив куколку (кокон) бабочки Idea Leuconoe (Идея Левконоя) для выращивания', 17, 5, );
INSERT INTO `chrysalis` (`id`, `typename`, `price`, `amount`, `description`, `timetoborn`, `typeid`, `img`) VALUES
(8, 'PAPILIO PALINURUS', 850, 40, 'Из этой куколки (кокона) бабочки рождается оригинальная живая бабочка Papilio Palinurus или как ее еще называют Парусник Палинур. Изящество бабочки Парусник Палинур заключается в контрастном сочетании зеленого и черного цвета. Размер бабочки составляет 9-11см. Данные бабочки очень хорошо подходят для приготовления салюта из бабочек, благодаря их красоте и активности. Также, живые бабочки Papilio Palinurus очень подходят для зимних садов и оранжерей, так как они находятся постоянно в движении, перелетая с цветка на цветок. Купив куколку (кокон) бабочки Papilio Palinurus (Парусник Палинур) для выращивания', 20, 6, );

